import React, { Component } from 'react';


class Todos extends Component {
    
  render() {
    console.log(this.props.todos);
    return this.props.todos.map(
        (todo) => (
          <Todoitem todo={todo} ></Todoitem>
        )
    )
  }
}

export default Todos;
